elaboracion:
Rallamos la parte naranja de la mandarina sin llegar a la parte blanca, ya que esta aporta un sabor amargo que no queremos;
Pelamos gajo a gajo la mandarina y trituramos todos los ingredientes con una batidora hasta obtener una mezcla homogénea;
Dejamos reposar la mezcla durante al menos 30 minutos en el frigorífico. Cuanto más tiempo esté en reposo, más espesará;
Calentamos una sartén con un poco de aceite de coco y vamos haciendo las tortitas a fuego medio;
Truco para que queden más gorditas: tapar la sartén mientras se hacen;
Cuando se formen pequeñas burbujas en la superficie de la tortita le daremos la vuelta.
